window.bookSummaryJSON = "<p><b>A wildly sexy, emotional, and suspenseful romance novel from number one </b><b><i>New York Times</i></b><b> best-selling author Lauren Blakely, with all new narration from Sebastian York and Vanessa Edwin, with special appearances from Shane East, January LaVoy, Jonathan Davis, Scott Brick, Sean Crisden and more!</b></p> <p>She was my \"what if\" girl. The one I longed for. The one I tried to find again after she left for the other side of the world.</p> <p>Now, years later, fate has swept the only woman I’ve ever loved back into my life.</p> <p>With her intensity, her honesty, her passion, Annalise tries to break down my walls, because she’s the one who knew me before my family shattered.</p> <p>When we collide again, it's tender and savage, gentle and rough, and makes me hungry for more of this electric, once-in-a-blue moon kind of connection.</p> <p>If I want to keep her close, I’ll have to serve up the whole truth of where I went and what I did after she left.</p> <p>But if I do, I risk losing her again, and that’s not a fate I’m ready to face. Not when each day brings me closer to finding the people who ripped my family apart and seeing them put behind bars.</p> <p>Until the day I learn Annalise is holding the final piece of the puzzle to solving the mystery.</p>"; 
